import React from "react";
import styled from "styled-components";
import BannerImg from "../assets/images/Banner-img.png"; // with import

const StyledBanner = styled.div`
  border-radius: 25px;
  height: 250px;
  width: 80%;
  margin: auto;
  position: relative;
  text-align: center;

  img {
    height: 100%;
    width: 100%;
    border-radius: 25px;
  }
  .filter {
    background-color: black;
    opacity: 0.3;
    height: 100%;
    width: 100%;
    border-radius: 25px;
    position: absolute;
    top: 0px;
    mix-blend-mode: darken;
  }

`;

export default function AppartementBanner() {
  return (
    <div>
      <StyledBanner>
        <img src="https://s3-eu-west-1.amazonaws.com/course.oc-static.com/projects/front-end-kasa-project/profile-picture-12.jpg" alt="nature img" />
        <div className="filter"></div>
      </StyledBanner>
    </div>
  );
}
